  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Pea Island NWR
  outlines Refuge accomplishments from May through August of 1961. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover during this period. Wildlife- including migratory birds, upland game
  birds, furbearers, raptors, fish, and reptiles- is also covered. The Refuge development
  and maintenance section discusses physical developments and vegetation control.
  Resource management is outlined; topics include commercial fishing. A progress report
  on field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses, Refuge visitors, Refuge participation,
  and safety. N-R forms and photographs are attached.\",\n\t\"license_title\": \"License
